import React from 'react';

const Home = ({ history }) => {
    const handleHome = () => {
        // Redirect to login page
        history.push('/');
      };
      
  return (
    <div className="container mt-5">
      <h1>Welcome to the React Home Page!</h1>
      <button style={{  paddingLeft: '200px'}} className="btn btn-danger button-left" onClick={handleHome}>Logout</button>
    </div>
  );
};

export default Home;
